// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.24;

import {Types} from "./libraries/Types.sol";
import {IOptimismPortal} from "./interfaces/IOptimismPortal.sol";
import {IL2Oracle} from "./interfaces/IL2Oracle.sol";

contract FastWithdraw {
    /* type declarations */

    /* state variables */
    IOptimismPortal private s_optimismPortal;
    IL2Oracle private s_l2Oracle;

    /* error messages */
    error NotProvenYet();
    error ProvenBugTimestamp();
    error JustFinalizeWithdrawalTransaction();
    error AlreadyFinalized();
    error SenderMustBeCaller();
    error TargetAddressMustBeThisContract();
    error FailedToSendValueToRequester();

    /* constructor */
    constructor(address _optimismPortal, address _l2Oracle) {
        s_optimismPortal = IOptimismPortal(_optimismPortal);
        s_l2Oracle = IL2Oracle(_l2Oracle);
    }

    receive() external payable {}

    function proveAndRequestFW(
        Types.WithdrawalTransaction memory _tx,
        uint256 _l2OutputIndex,
        Types.OutputRootProof calldata _outputRootProof,
        bytes[] calldata _withdrawalProof
    ) public {
        // check
        if (_tx.sender != msg.sender) {
            revert SenderMustBeCaller();
        }
        if (_tx.target != address(this)) {
            //revert("OptimismPortal: target address must be this contract")
            revert TargetAddressMustBeThisContract();
        }

        // prove
        IOptimismPortal optimismPortal = s_optimismPortal;
        optimismPortal.proveWithdrawalTransaction(
            _tx,
            _l2OutputIndex,
            _outputRootProof,
            _withdrawalProof
        );

        bytes32 withdrawalHash = keccak256(
            abi.encode(
                _tx.nonce,
                msg.sender,
                address(this),
                _tx.value,
                _tx.gasLimit,
                _tx.data
            )
        );

        IOptimismPortal.ProvenWithdrawal
            memory provenWithdrawal = optimismPortal.provenWithdrawals(
                withdrawalHash
            );

        isWithdrawalProven(provenWithdrawal, s_l2Oracle);

        // *** FW logic from here ***
        // send value 90%
        bool success = send(_tx.sender, gasleft(), (_tx.value * 9) / 10);
        if (!success) {
            //revert("Failed to send value to sender");
            revert FailedToSendValueToRequester();
        }
    }

    function requestFW(Types.WithdrawalTx memory withdrawalTx) public {
        IOptimismPortal optimismPortal = s_optimismPortal;
        IL2Oracle l2Oracle = s_l2Oracle;

        bytes32 withdrawalHash = keccak256(
            abi.encode(
                withdrawalTx.nonce,
                msg.sender,
                address(this),
                withdrawalTx.value,
                withdrawalTx.gasLimit,
                withdrawalTx.data
            )
        );
        IOptimismPortal.ProvenWithdrawal
            memory provenWithdrawal = optimismPortal.provenWithdrawals(
                withdrawalHash
            );

        isWithdrawalProven(provenWithdrawal, l2Oracle);

        // Check that this withdrawal has not already been finalized
        if (optimismPortal.finalizedWithdrawals(withdrawalHash)) {
            revert AlreadyFinalized();
        }

        // *** FW logic from here ***

        bool success = send(
            msg.sender,
            gasleft(),
            (withdrawalTx.value * 9) / 10
        );
        if (!success) {
            //revert("Failed to send value to sender");
            revert FailedToSendValueToRequester();
        }
    }

    /// @notice Determines whether the finalization period has elapsed with respect to
    ///         the provided block timestamp.
    /// @param _timestamp Timestamp to check.
    /// @return Whether or not the finalization period has elapsed.
    function _isFinalizationPeriodElapsed(
        uint256 _timestamp,
        IL2Oracle l2Oracle
    ) internal view returns (bool) {
        return
            block.timestamp > _timestamp + l2Oracle.finalizationPeriodSeconds();
    }

    function isWithdrawalProven(
        IOptimismPortal.ProvenWithdrawal memory provenWithdrawal,
        IL2Oracle l2Oracle
    ) internal view {
        // We know that a withdrawal has
        // been proven at least once when its timestamp is non-zero. Unproven withdrawals will have
        // a timestamp of zero.
        if (provenWithdrawal.timestamp == 0) {
            //revert("OptimismPortal: withdrawal has not been proven yet");
            revert NotProvenYet();
        }

        // As a sanity check, we make sure that the proven withdrawal's timestamp is greater than
        // starting timestamp inside the L2OutputOracle. Not strictly necessary but extra layer of
        // safety against weird bugs in the proving step.
        // require(
        //     provenWithdrawal.timestamp >= s_l2Oracle.startingTimestamp(),
        //     "OptimismPortal: withdrawal timestamp less than L2 Oracle starting timestamp"
        // );
        if (provenWithdrawal.timestamp < l2Oracle.startingTimestamp()) {
            revert ProvenBugTimestamp();
        }

        if (
            _isFinalizationPeriodElapsed(provenWithdrawal.timestamp, l2Oracle)
        ) {
            revert JustFinalizeWithdrawalTransaction();
        }

        // Grab the OutputProposal from the L2OutputOracle, will revert if the output that
        // corresponds to the given index has not been proposed yet.
        IL2Oracle.OutputProposal memory proposal = l2Oracle.getL2Output(
            provenWithdrawal.l2OutputIndex
        );

        // Check that the output root that was used to prove the withdrawal is the same as the
        // current output root for the given output index. An output root may change if it is
        // deleted by the challenger address and then re-proposed.
        require(
            proposal.outputRoot == provenWithdrawal.outputRoot,
            "OptimismPortal: output root proven is not the same as current output root"
        );

        // Check that the output proposal has also been finalized.
        // require(
        //     _isFinalizationPeriodElapsed(proposal.timestamp),
        //     "OptimismPortal: output proposal finalization period has not elapsed"
        // );
        if (_isFinalizationPeriodElapsed(proposal.timestamp, l2Oracle)) {
            revert JustFinalizeWithdrawalTransaction();
        }
    }

    /// @notice Performs a low level call without copying any returndata.
    /// @dev Passes no calldata to the call context.
    /// @param _target   Address to call
    /// @param _gas      Amount of gas to pass to the call
    /// @param _value    Amount of value to pass to the call
    function send(
        address _target,
        uint256 _gas,
        uint256 _value
    ) internal returns (bool) {
        bool _success;
        assembly {
            _success := call(
                _gas, // gas
                _target, // recipient
                _value, // ether value
                0, // inloc
                0, // inlen
                0, // outloc
                0 // outlen
            )
        }
        return _success;
    }
}

